import styles from "./AppHeader.module.css";
// import { data } from "../../utils/data";
import { ProfileIcon, BurgerIcon, ListIcon, Logo } from "@ya.praktikum/react-developer-burger-ui-components/dist/ui/icons";

function AppHeader() {
  return (
    <header
      className={styles.AppHeader}
      style={{ color: "white", backgroundColor: "#1C1C21" }}
    >
      <div style={{ display: "flex" }}>
        <div className="pl-5 pb-4 pt-4 pr-2">
          <BurgerIcon type="primary" />
        </div>
        <div className="pl-2 pb-4 pt-4 pr-5 mr-2">
          <nav className="text text_type_main-default">Конструктор</nav>
        </div>
        <div className="pl-5 pb-4 pt-4 pr-2">
          <ListIcon type="secondary" />
        </div>
        <div className="pl-2 pb-4 pt-4 pr-5">
          <nav className="text text_type_main-default text_color_inactive">
            Лента заказов
          </nav>
        </div>
      </div>
      <Logo />
      <div style={{ display: "flex" }}>
        <div className="pl-5 pb-4 pt-4 pr-2">
          <ProfileIcon type="secondary" />
        </div>
        <div className="pl-2 pb-4 pt-4 pr-">
          <nav className="text text_type_main-default text_color_inactive">
            Личный кабинет
          </nav>
        </div>
      </div>
    </header>
  );
}

export default AppHeader;
